import React, { useState } from 'react';
import emailIcon from "./Components/email.png";
import passIcon from "./Components/password.png";
import './login.css';

const Login = () => {
  const [action, setAction] = useState("Login");
  const [email, setEmail] = useState("");
  const [emailError, setEmailError] = useState("");
  const [password, setPassword] = useState("");
  const [passwordError, setPasswordError] = useState("");

  // Password validation
  const handlePasswordChange = (e) => {
    const value = e.target.value;
    setPassword(value);

    if (value.length < 8 || value.length > 16) {
      setPasswordError("Password must be 8 to 16 characters");
    } else {
      setPasswordError("");
    }
  };

  // Email validation with allowed domains
  const handleEmailChange = (e) => {
    const value = e.target.value;
    setEmail(value);

    const allowedDomains = ["cvsu.edu.ph", "gmail.com", "yahoo.com"];
    const emailParts = value.split("@");

    if (emailParts.length !== 2) {
      setEmailError("It must be a valid email");
      return;
    }

    const domain = emailParts[1].toLowerCase();
    if (!allowedDomains.includes(domain)) {
      setEmailError(`It must be a valid email`);
    } else {
      setEmailError("");
    }
  };

  return (
    <div className="container">
      <div className="header">
        <div className="text">{action}</div>
        <div className="underline"></div>
      </div>

      <div className="inputs">
        {action === "Login" ? (
          <>
            {/* Email input */}
            <div className="input" style={{ flexDirection: "column" }}>
              <div style={{ display: "flex", alignItems: "center", gap: "8px" }}>
                <img src={emailIcon} alt="email icon" />
                <input
                  type="email"
                  placeholder="Email ID"
                  value={email}
                  onChange={handleEmailChange}
                  style={{ flex: 1, padding: "8px", fontSize: "14px" }}
                />
              </div>
              {emailError && (
                <span style={{ color: "red", fontSize: "12px", marginTop: "4px" }}>
                  {emailError}
                </span>
              )}
            </div>

            {/* Password input */}
            <div className="input" style={{ flexDirection: "column" }}>
              <div style={{ display: "flex", alignItems: "center", gap: "8px" }}>
                <img src={passIcon} alt="password icon" />
                <input
                  type="password"
                  placeholder="Password"
                  value={password}
                  onChange={handlePasswordChange}
                  style={{ flex: 1, padding: "8px", fontSize: "14px" }}
                />
              </div>
              {passwordError && (
                <span style={{ color: "red", fontSize: "12px", marginTop: "4px" }}>
                  {passwordError}
                </span>
              )}
            </div>
          </>
        ) : (
          <>
            <div className="input">
              <input type="text" placeholder="First Name" />
            </div>
            <div className="input">
              <input type="text" placeholder="Last Name" />
            </div>
            <div className="input">
              <label htmlFor="birthday">Birthday:</label>
              <input type="date" id="birthday" name="birthday" />
            </div>
            <div className="input">
              <label>Gender:</label>
              <input type="radio" id="male" name="gender" value="male" />
              <label htmlFor="male">Male</label>
              <input type="radio" id="female" name="gender" value="female" />
              <label htmlFor="female">Female</label>
              <div className="input" style={{ flexDirection: "column" }}>
                <div style={{ display: "flex", alignItems: "center", gap: "8px" }}>
                  <img src={emailIcon} alt="email icon" />
                  <input
                    type="email"
                    placeholder="Email ID"
                    value={email}
                    onChange={handleEmailChange}
                  />
                </div>
              </div>
            </div>
          </>
        )}
      </div>

      {action === "Sign up" ? (
        <div></div>
      ) : (
        <div className="forgetpass">
          Forgot Password? <span>Click here!</span>
        </div>
      )}

      <div className="submit-container">
        <div
          className={action === "Login" ? "submit gray" : "submit"}
          onClick={() => setAction("Sign up")}
        >
          Sign up
        </div>
        <div
          className={action === "Sign up" ? "submit gray" : "submit"}
          onClick={() => setAction("Login")}
        >
          Login
        </div>
      </div>
    </div>
  );
};

export default Login;
